  true,\n\t\"url\": null,\n\t\"notes\": \"The Version-3 Formaldehyde Product OMHCHO
  from the Aura-OMI is now  available (http://disc.gsfc.nasa.gov/Aura/OMI/omhcho_v003.shtml)
  from the NASA Goddard Earth Sciences Data and Information Services Center (GES DISC)
  for the  public access.nn(The shortname for this Level-2 OMI total column Formaldehyde
  product is OMHCHO) nThe algorithm leads for this product are the US OMI scientists
  Dr. Kelly Chance (kchance@cfa.harvard.edu) and Dr. Thomas Kurosu (tkurosu@cfa.harvard.edu)
  from the Harvard-Smithsonian Center, Cambridge, MA.n nThe OMHCHO product contains
  total vertical column HCHO, standard erros (rms and sigma), quality flags, geolocation
  and other ancillary information.nnOMHCHO files are stored in EOS Hierarchical Data
  Format (HDF-EOS5). Each file contains data from the day lit portion of an orbit
  (~53 minutes). There are approximately 14 orbits per day. The average file size
  for the OMHCHO data product is about 5 Mbytes.nnA short OMHCHO Readme Document that
  includes brief algorithm description and documents that provides known data quality
  related issues are available from the Harvard-Smithsonian Center site: http://www.cfa.harvard.edu/~tkurosu/SatelliteInstruments/OMI/PGEReleases/\",\n\t\"license_title\":
